    {title: 'Toilet Paper', amount: 335.67, date: new Date(2021, 2, 28)},
    {title: 'Wodden Desk', amount: 335.67, date: new Date(2021, 2, 28)},
    {title: 'Gym Membership', amount: 335.67, date: new Date(2021, 2, 28)},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title = {expenses[0].title} amount={expenses[0]}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

